const {
  countMoney,
} = require("../../src/yandex-first-tasks/count-startup-money");

test("Only one owner", () => {
  expect(countMoney(2300, 1, 10)).toBe("23000000000000");
});

test("Test case 1: possible to count", () => {
  expect(countMoney(21, 108, 1)).toBe("216");
});

test("Test case 2: impossible to count", () => {
  expect(countMoney(5, 12, 4)).toBe("-1");
});

test("Minimum values", () => {
  expect(countMoney(1, 1, 1)).toBe("10");
});

test("several days", () => {
  expect(countMoney(12, 2, 4)).toBe("120000");
});


test("failed data", () => {
  expect(countMoney(29420920, 98069736, 69929)).toBe(
    ""
  );
});

test.skip("Test case 3: large income and days", () => {
  expect(countMoney(1_000_000_000, 1, 1_000_00)).toBe(
    String(1_000_000_000 ** 1_000_00)
  );
});
